import api from '@/request/index.js'
// 登录
export const postRequest = (telephoneNum,code) => {
    return api({
        url: '/hello',
        method: 'POST',
        headers:{
        },
        params:{telephoneNum,code}

    })
}
export const getRequest = (data) => {
    return api({
        url: '/hello',
        method: 'GET',
        data
    })
}
